import { grey } from '@material-ui/core/colors';
import './App.css';
import SimpleBottomNavigation from './SimpleBottomNavigation';

function App() {

  const headingContainer = (
    <div className="user-header">
      <div className="placeholderCircle" />
      <div className="headingContainerRight">
        <div className="placeholderCircle2" />
        <div className="placeholderCircle2" />
      </div>
    </div>
  )

  const headingTitle = () => {
    return (
      <div style={{marginTop: 16, height: 100}}>
        <p style={{color: grey, fontSize: 24, fontWeight: 700}}>Favorites</p>
        <p style={{color: grey, fontSize: 12}}>My Favorite Collection</p>
      </div>
    )
  }

  const mainContainer = () => {
    return (
      <div className="galleryContainer">
        <div className="addToFavorite"/>
        <div className="addToFavorite"/>
        <div className="addToFavorite"/>
        <div className="addToFavorite"/>
        <div className="addToFavorite"/>
      </div>
    )
  }

  return (
    <div className="App">
      <div className="ext-container">
        {headingContainer}
        {headingTitle()}
        {mainContainer()}
        <SimpleBottomNavigation/>
      </div>

    </div>
  )

}

export default App;
